import React from "react";

interface Props {
  start_x: number;
  start_y: string;
  end_x: string;
  end_y: string;
  hiearchy_number: number;
  list_of_subjects: string[];
}

const Arrow = ({
  start_x,
  end_x,
  start_y,
  end_y,
  hiearchy_number = 0,
  list_of_subjects,
}: Props) => {
  const concentration_positions: any[] = [
    ["synthetic", ["19.09%", "64.72%"]],
    ["cell", ["44.09%", "64.72%"]],
    ["devices", ["69.09%", "64.72%"]],
    ["imaging", ["69.09%", "64.72%"]],
  ];
  let sideLine: string;
  let bottomLine: string;
  sideLine = "'".concat((start_x + 5).toString(), "");
  bottomLine = "'".concat((hiearchy_number + 63).toString(), "%'");
  console.log(sideLine, bottomLine);
  return (
    <svg className="full">
      <line
        className="arrow"
        x1={start_x}
        y1={start_y}
        x2={sideLine}
        y2={start_y}
      />
      <line
        className="arrow"
        x1={sideLine}
        y1={start_y}
        x2={sideLine}
        y2={bottomLine}
      />
      <line
        className="arrow"
        x1={sideLine}
        y1={start_y}
        x2={sideLine}
        y2={bottomLine}
      />
    </svg>
  );
};

export default Arrow;
